unsigned char pt3array(unsigned int addr){
	return pgm_read_byte(&(pt3dump[addr]));
}

void setOrn(unsigned char numCh, unsigned int numOrn){
	cur_orn_start[numCh]=pt3array(169+numOrn*2)+pt3array(170+numOrn*2)*256;
	cur_orn[numCh]=cur_orn_start[numCh]+2;
	cur_orn_loop[numCh]=pt3array(cur_orn_start[numCh])+cur_orn_start[numCh]+2;
	cur_orn_end[numCh]=pt3array(cur_orn_start[numCh]+1)+cur_orn_start[numCh]+2;
}
	
void setSample(unsigned char numCh, int numSampleMul2){
	cur_sample_start[numCh]=pt3array(105+numSampleMul2)+pt3array(106+numSampleMul2)*256;
	cur_sample[numCh]=cur_sample_start[numCh]+2;
	cur_sample_loop[numCh]=pt3array(cur_sample_start[numCh])*4+cur_sample_start[numCh]+2;
	cur_sample_end[numCh]=pt3array(cur_sample_start[numCh]+1)*4+cur_sample_start[numCh]+2;		
	cur_sample_sv_base[numCh]=0x00;
	cur_sample_tone_base[numCh]=0;
}
	
void setNote(unsigned char numCh, unsigned char numNote){
	cur_note[numCh] = (numNote);
	cur_orn[numCh]=cur_orn_start[numCh]+2;
	cur_orn_loop[numCh]=pt3array(cur_orn_start[numCh])+cur_orn_start[numCh]+2;
	cur_orn_end[numCh]=pt3array(cur_orn_start[numCh]+1)+cur_orn_start[numCh]+2;
	cur_sample[numCh]=cur_sample_start[numCh]+2;
	cur_sample_loop[numCh]=pt3array(cur_sample_start[numCh])*4+cur_sample_start[numCh]+2;
	cur_sample_end[numCh]=pt3array(cur_sample_start[numCh]+1)*4+cur_sample_start[numCh]+2;
	cur_sample_sv_base[numCh]=0x00;
	cur_sample_tone_base[numCh]=0;
	spec_com[numCh]=0;
	spec_accum[numCh]=0;		
	cur_noise=0x00;
	cur_sample_env_base[numCh]=0;
	cur_sample_noise_base[numCh]=0;
}

void processLine(unsigned char numCh){
	unsigned char spec_com_new = 0;//special command occured
	unsigned char is_line_braked = 0;//special command occured
	if(--cur_line[numCh]<=0){
		spec_com_new=0;
		//process line
		while(!is_line_braked){
			cur_com = pt3array(cur_pat_add[numCh]++);
			switch (cur_com) {
				case 0x00://end of line
				is_line_braked=1;
				break;
				case 0x10://set 0 orn, set sample, turn off env
				setOrn(numCh, 0);
				setSample(numCh,(pt3array(cur_pat_add[numCh]++)));
				is_env[numCh]=0;
				break;
				case 0xB0://turn off env
				is_env[numCh]=0;
				break;
				case 0xB1://set line duration
				line_dur[numCh]=pt3array(cur_pat_add[numCh]++);
				break;
				case 0xC0://pause and break line
				cur_note[numCh]=0xFF;
				cur_sample_env_base[numCh]=0;
				cur_sample_noise_base[numCh]=0;
				is_line_braked=1;
				break;
				case 0xD0://end of line
				is_line_braked=1;
				break;
				default:
				if((cur_com&0xF0)==0x00){//special command
					spec_com_new=cur_com;
					break;
				}
				if((cur_com&0xF0)==0x10){//set 0 orn, set sample, set env
					setOrn(numCh, 0);
					is_env[numCh]=1;
					cur_env=pt3array(cur_pat_add[numCh])*256 + pt3array(cur_pat_add[numCh] + 1);
					cur_pat_add[numCh] += 2;
					cur_env_type=(cur_com&0x0F)-1;
					is_env_ch=1;
					setSample(numCh,(pt3array(cur_pat_add[numCh]++)));
					spec_env_accum=0;
					break;
				}
				if((cur_com&0xE0)==0x20){//set noise
					cur_noise = (char)(cur_com-0x20);//cavr
					is_noise_ch=1;
					break;
				}
				if((cur_com&0xF0)==0x40){//set orn
					setOrn(numCh,(cur_com&0x0F));
					break;
				}
				if(cur_com>=0x50&&cur_com<=0xAF){//set note
					setNote(numCh, cur_com - 0x50);
					is_line_braked=1;
					break;
				}
				if((cur_com&0xF0)==0xB0){//set 0 orn, set env
					//setOrn(numCh, 0);
					is_env[numCh]=1;
					cur_env=pt3array(cur_pat_add[numCh])*256 + pt3array(cur_pat_add[numCh] + 1);
					cur_pat_add[numCh] += 2;
					cur_env_type=(cur_com&0x0F)-1;
					is_env_ch=1;
					spec_env_accum=0;
					break;
				}
				if((cur_com&0xF0)==0xC0){//set volume
					cur_vol[numCh]=(char)(cur_com&0x0F);//cavr
					break;
				}
				if(cur_com>=0xD1&&cur_com<=0xEF){//set sample
					setSample(numCh, (cur_com-0xD0)*2);
					break;
				}
				if((cur_com&0xF0)==0xF0){//set orn and sample, turn off env
					setOrn(numCh,(cur_com&0x0F));
					setSample(numCh,pt3array(cur_pat_add[numCh]++));
					is_env[numCh] = 0;
					break;
				}
			}//switch
		}//while line not brake
		switch(spec_com_new){
			case 0x00:
			break;
			case 0x01:
			spec_com[numCh] = 0x01;
			spec_del[numCh] = pt3array(cur_pat_add[numCh]++);
			spec_par1[numCh] = pt3array(cur_pat_add[numCh]) + pt3array(cur_pat_add[numCh] + 1)*256;
			cur_pat_add[numCh] += 2;
			spec_del_count[numCh]=(char)(spec_del[numCh]);//cavr
			break;
			case 0x02:
			spec_com[numCh] = 0x02;
			spec_del[numCh] = pt3array(cur_pat_add[numCh]++);
			spec_par2[numCh] = pt3array(cur_pat_add[numCh]) + pt3array(cur_pat_add[numCh] + 1)*256;
			cur_pat_add[numCh] += 2;
			spec_par1[numCh] = pt3array(cur_pat_add[numCh]) + pt3array(cur_pat_add[numCh] + 1)*256;
			cur_pat_add[numCh] += 2;
			spec_del_count[numCh]=(char)(spec_del[numCh]);//cavr
			if((spec_par1[numCh]&0x8000)==0x0000)
			spec_accum[numCh]=(0-spec_par2[numCh])&0xFFFF;//cavr
			else spec_accum[numCh]=spec_par2[numCh];
			break;
			case 0x03:
			spec_com[numCh] = 0x03;
			spec_del[numCh] = pt3array(cur_pat_add[numCh]++);
			break;
			case 0x04:
			spec_com[numCh] = 0x04;
			spec_del[numCh] = pt3array(cur_pat_add[numCh]++);
			break;
			case 0x05:
			spec_com[numCh] = 0x05;
			spec_par1[numCh] = pt3array(cur_pat_add[numCh]++);
			spec_par2[numCh] = pt3array(cur_pat_add[numCh]++);
			break;
			case 0x08:
			spec_com[numCh] = 0x08;
			spec_del[numCh] = pt3array(cur_pat_add[numCh]++);
			spec_par1[numCh] = pt3array(cur_pat_add[numCh]) + pt3array(cur_pat_add[numCh] + 1)*256;
			cur_pat_add[numCh] += 2;
			spec_del_count[numCh]=(char)(spec_del[numCh]);
			break;
			case 0x09:
			tempo = pt3array(cur_pat_add[numCh]++);
			break;
		}
		cur_line[numCh]=line_dur[numCh];
	}//if line A process
}

void playOrnSample(unsigned char numCh){//cavr char
	unsigned int tmp=0;
	unsigned char tmp_sampleL;
	unsigned char tmp_sampleH;
	unsigned int tmp_sample_tone=0;
	if(cur_note[numCh]!=0xFF){
		tmp = (cur_note[numCh]+pt3array(cur_orn[numCh]++))&0xFF;//cavr
		if(tmp>=96)tmp=95;else if((tmp&0x8000)!=0x0000)tmp=0;
		switch(notetablenum){
			case 1:
			tmp = pgm_read_word(&(notetable1[tmp]));
			break;
			case 2:
			tmp = pgm_read_word(&(notetable2[tmp]));
			break;
		}
		if(cur_orn[numCh]>=cur_orn_end[numCh])cur_orn[numCh]=cur_orn_loop[numCh];
		tmp_sampleH=pt3array(cur_sample[numCh]++);
		tmp_sampleL=pt3array(cur_sample[numCh]++);
		tmp_sample_tone=pt3array(cur_sample[numCh]) + pt3array(cur_sample[numCh] + 1)*256;
		cur_sample[numCh] += 2;
		if(cur_sample[numCh]>=cur_sample_end[numCh])cur_sample[numCh]=cur_sample_loop[numCh];
		tmp+=cur_sample_tone_base[numCh]+tmp_sample_tone;
		if((tmp_sampleL&0x40)==0x40)cur_sample_tone_base[numCh]+=tmp_sample_tone;
		tmp+=spec_accum[numCh];
		if(spec_com[numCh]==0x01){//gliss
			if(--spec_del_count[numCh]==0){
				spec_del_count[numCh]=spec_del[numCh];
				spec_accum[numCh]+=spec_par1[numCh];
			}
		}
		if(spec_com[numCh]==0x02){//portamento
			if(--spec_del_count[numCh]==0){
				spec_accum[numCh]+=spec_par1[numCh];
				spec_accum[numCh]&=0xFFFF;//cavr
				spec_del_count[numCh]=spec_del[numCh];
				if((spec_par1[numCh]&0x8000)==0x0000){//for port+
					if((spec_accum[numCh]&0x8000)==0x0000){
						spec_accum[numCh]=0;
						spec_com[numCh]=0;
					}
					}else{//for port-
					if((spec_accum[numCh]&0x8000)==0x8000){
						spec_accum[numCh]=0;
						spec_com[numCh]=0;
					}
				}
			}
		}
		if(spec_com[numCh]==0x08){
			if(--spec_del_count[numCh]==0){
				spec_del_count[numCh]=spec_del[numCh];
				spec_env_accum+=spec_par1[numCh];
			}
		}
		//regs[reg_p++]=(char)(0x00+(numCh<<1));//cavr
		//regs[reg_p++]=(char)tmp;//cavr
		//regs[reg_p++]=(char)(0x01+(numCh<<1));//cavr
		//regs[reg_p++]=(char)((tmp>>8)&0x0F);//cavr
		tone_reg[numCh]=tmp;
		if((tmp_sampleL&0x80)==0x80){
			if((tmp_sampleL&0x20)==0x20){
				if((tmp_sampleH&0x20)==0x20)cur_sample_env_base[numCh]-=(tmp_sampleH>>1)&0x0F;
				else cur_sample_env_base[numCh]+=(tmp_sampleH>>1)&0x0F;
				if((cur_sample_env_base[numCh]&0x80)==0x80)cur_sample_env_base[numCh]|=0xFF00;
			}
			env_add+=cur_sample_env_base[numCh];
			}else{
			noise_add=(char)(((tmp_sampleH>>1)&0x1F)+cur_sample_noise_base[numCh]);
			if((tmp_sampleL&0x20)==0x20)cur_sample_noise_base[numCh]=(char)noise_add;//cavr
		}
		mixer_reg|=(((tmp_sampleL>>4)&0x09)<<numCh);//for A
		if((tmp_sampleH&0x80)==0x80){
			if((tmp_sampleH&0x40)==0x40){
				cur_sample_sv_base[numCh]++;
				if((cur_sample_sv_base[numCh]&0xF0)!=0x00)cur_sample_sv_base[numCh]=0x0F;
			}
			else{
				cur_sample_sv_base[numCh]--;
				if((cur_sample_sv_base[numCh]&0xF0)!=0x00&&(cur_sample_sv_base[numCh]&0xF0)!=0xF0)cur_sample_sv_base[numCh]=0xF0;
			}
		}
		tmp=(tmp_sampleL&0x000F)+cur_sample_sv_base[numCh];
		if((tmp&0x0080)!=0)tmp=0x0000;//cavr
		else if ((tmp&0x0070)!=0x00)tmp&=0x000F;//cavr
		tmp=(pgm_read_byte(&(voltable[(tmp&0x000F)+16*cur_vol[numCh]])));
		if(is_env[numCh]==1&&((tmp_sampleH&0x01)==0x00))tmp|=0x10;
		//regs[reg_p++]=(char)(0x08+numCh); //cavr
		//regs[reg_p++]=(char)(tmp);//cavr
		ampl_reg[numCh]=tmp;
		//cur_vol_reg[numCh]=(char)(tmp);//cavr delete this!
		}else{//pause
		//regs[reg_p++]=(char)(0x08+numCh); //cavr
		//regs[reg_p++]=0x00;//cavr
		ampl_reg[numCh]=0;
		//cur_vol_reg[numCh]=(char)(tmp);//cavr delete this!
	}
}

